import React from "react";

import SkillSub from "./Skill_sub";

import Reacts from "./Photo/React.png";
import Python from "./Photo/Python.png";
import nodejs from "./Photo/nodejs.png";
import js from "./Photo/js.png";
import MOngdb from "./Photo/mongodb.png";
// import nodejs from "./Photo/";
const Skill = () => {

    return (
        <section className="skill-box" id="skill-box">
            <h1 className="h1" style={{ color: "aliceblue" }}>Skill</h1>
            <h5 className="h5" style={{ color: "aliceblue" }}> what I Provide</h5>
            <ul className="skill_card">
                <li className="card"><SkillSub imgs={Reacts}></SkillSub></li>
                <li className="card"> <SkillSub imgs={Python}></SkillSub></li>
                <li className="card"><SkillSub imgs={nodejs}></SkillSub></li>
            </ul>
            <ul className="skill_card">
                <li className="card"><SkillSub imgs={js}></SkillSub></li>
                <li className="card"> <SkillSub imgs={MOngdb}></SkillSub></li>
                <li className="card"><SkillSub imgs={nodejs}></SkillSub></li>
            </ul>
        </section>
    )
}

export default Skill
